import Head from 'next/head';
import React from 'react';
import Header from '../components/header';
import Button from '../components/button';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCircle } from '@fortawesome/free-regular-svg-icons';

const HomePage = () => {
	return (
		<>
			<Head>
				<title>
					I Create Software That Helps You Stand Out. | Strobe's Website
				</title>
			</Head>
			<body>
				<Header />
				<main>
					<div className="h-screen flex flex-col items-center justify-center">
						<div className="flex flex-col items-center text-center">
							<p className="uppercase tracking-ultrawide text-primary-text">
								Ryan Devoe
							</p>
							<h1 className="leading-normal mt-10">
								I Create Software That Helps You
								<br />
								<span className="text-primary-color">Stand Out.</span>
							</h1>
							<Button className="space-x-4">
								<div className="w-3 h-3 border-2 border-primary-text" />
								<p>Contact</p>
							</Button>
						</div>
					</div>
				</main>
			</body>
		</>
	);
};

export default HomePage;

export const getStaticProps = async () => {
	return {
		props: {},
	};
};
